import React from "react";
import { useSelector, useDispatch } from "react-redux";
import "../App.css";

export const Lines = () => {
  const { lines } = useSelector(state => state.linesReduser);

  return (
    <div>
      {lines.map((line, index) => {
        <div key={index}>
          <h3>Line {index} </h3>
          <span>First point</span>
          <input type="text" placeholder="X"></input>
          <input type="text" placeholder="Y"></input>
          <span>Second point</span>
          <input type="text" placeholder="X"></input>
          <input type="text" placeholder="Y"></input>
        </div>;
      })}
    </div>
  );
};
